// Extract unique thread IDs from all input items
const threadIds = new Set();

for (const item of items) {
  if (item.json.threadId) {
    threadIds.add(item.json.threadId);
  }
}

// Create new items array with unique thread IDs
return Array.from(threadIds).map(threadId => ({
  json: {
    threadId: threadId
  }
}));

// Process thread data (Run in "Run Once for All Items" mode)
const processedItems = [];
const MAX_MESSAGES = 500; // Limit for large threads

// Get all input items
const inputItems = $input.all();

// Helper function to get header value
const getHeader = (headers, name) => {
  if (!headers) return null;
  const header = headers.find(h => h.name.toLowerCase() === name.toLowerCase());
  return header ? header.value : null;
};

// Helper to extract headers from message payload
const extractHeaders = (payload) => {
  if (payload.headers) return payload.headers;
  if (payload.parts) {
    for (const part of payload.parts) {
      if (part.headers) return part.headers;
      if (part.parts) {
        for (const subPart of part.parts) {
          if (subPart.headers) return subPart.headers;
        }
      }
    }
  }
  return [];
};

// Helper to extract text content
const extractTextContent = (payload) => {
  if (payload.mimeType === 'text/plain' && payload.body?.data) {
    return Buffer.from(payload.body.data, 'base64').toString('utf-8');
  }
  if (payload.parts) {
    for (const part of payload.parts) {
      if (part.mimeType === 'text/plain' && part.body?.data) {
        return Buffer.from(part.body.data, 'base64').toString('utf-8');
      }
    }
  }
  return '';
};

for (const item of inputItems) {
  const thread = item.json;
  if (!thread || !thread.messages || thread.messages.length === 0) continue;

  // Handle large threads
  const messages = thread.messages.length > MAX_MESSAGES 
    ? thread.messages.slice(0, MAX_MESSAGES) 
    : thread.messages;

  const firstMessage = messages[0];
  const lastMessage = messages[messages.length - 1];

  // Initialize collections
  const participantSet = new Set();
  const labelSet = new Set();
  let combinedText = "";

  for (const [index, msg] of messages.entries()) {
    if (!msg.payload) continue;

    // Extract headers
    const headers = extractHeaders(msg.payload);

    // Extract and add participants
    const from = getHeader(headers, 'From');
    const to = getHeader(headers, 'To');
    const cc = getHeader(headers, 'Cc');

    if (from) participantSet.add(from.trim());
    if (to) to.split(',').map(a => a.trim()).filter(a => a).forEach(a => participantSet.add(a));
    if (cc) cc.split(',').map(a => a.trim()).filter(a => a).forEach(a => participantSet.add(a));

    // Extract and add labels
    if (msg.labelIds) {
      msg.labelIds.forEach(labelId => labelSet.add(labelId));
    }

    // Extract and add text content
    const messageText = extractTextContent(msg.payload) || msg.snippet || '';
    combinedText += `--- Message ${index + 1} ---\n${messageText}\n\n`;
  }

  // Extract subject from first message
  const firstHeaders = firstMessage.payload ? extractHeaders(firstMessage.payload) : [];
  const subject = getHeader(firstHeaders, 'Subject') || '';

  processedItems.push({
    json: {
      threadId: thread.id,
      subject: subject,
      text: combinedText.trim(),
      labels: Array.from(labelSet).join(', '),
      participants: Array.from(participantSet).join('; '),
      firstMessageDate: firstMessage.internalDate,
      lastMessageDate: lastMessage.internalDate,
      messageCount: messages.length
    }
  });
}

return processedItems;

