// Set mode to: "Run Once for All Items"
const MAX_TEXT_LENGTH = 45000;
const inputItems = $input.all();
const results = [];

for (let i = 0; i < inputItems.length; i++) {
    const item = inputItems[i];
    const jsonData = item.json;
    const text = jsonData.text || '';
    const otherFields = { ...jsonData };
    delete otherFields.text;

    if (text.length > MAX_TEXT_LENGTH) {
        results.push({
            json: {
                ...otherFields,
                originalTextLength: text.length,
                text: "TO_BE_SUMMARIZED",
                needsSummarization: true,
                fullText: text
            },
            // Maintain item linking
            pairedItem: {
                item: i
            }
        });
    } else {
        results.push({
            json: {
                ...jsonData,
                needsSummarization: false,
                originalTextLength: text.length
            },
            // Maintain item linking
            pairedItem: {
                item: i
            }
        });
    }
}

return results;

// Set mode: "Run Once for Each Item"
const inputItem = $input.item;

// Validate input structure
if (!inputItem || !inputItem.json || !inputItem.json.output) {
    return {
        json: { 
            error: "Invalid input structure",
            details: "Missing required 'output' property" 
        }
    };
}

try {
    // Parse the JSON string from the output property
    const agentOutput = JSON.parse(inputItem.json.output);

    // Return the extracted fields
    return {
        json: {
            "summarized body": agentOutput["summarized body"],
            "thread id": agentOutput.threadid
        }
    };
} catch (error) {
    // Handle errors safely
    const errorMessage = error instanceof Error ? error.message : String(error);

    return {
        json: { 
            error: "Failed to parse agent output",
            details: errorMessage,
            originalOutput: inputItem.json.output
        }
    };
}

